export class Anime{
  private _id: number;

  public get id(): number {
    return this._id;
  }

  public set id(value: number) {
    this._id = value;
  }

  private nome: string;
  private ano: number;
  private quantidadeDeTemporada: number;
  private img: string;

  constructor(id: number, nome: string, ano: number, quantidadeDeTemporada: number, img: string){
    this._id = id;
    this.nome = nome;
    this.ano = ano;
    this.quantidadeDeTemporada = quantidadeDeTemporada;
    this.img = img;
  }

}
